define({"topics":[{"title":"<ph>12.4.1<\/ph>\nCalculating Power","shortdesc":"<p class=\"shortdesc\">Use the following steps to calculate the power consumption of your design. The list of         screens and steps appear in the order in which you should view them to analyze your power         accurately.<\/p>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-FE220513-1C98-4FCF-9A87-E75755867CE7","attributes":{"data-id":"GUID-FE220513-1C98-4FCF-9A87-E75755867CE7"},"menu":{"hasChildren":false},"tocID":"GUID-FE220513-1C98-4FCF-9A87-E75755867CE7-d10733e10755","topics":[]},{"title":"<ph>12.4.2<\/ph>\nExtracting Power Consumption of a Specific Clock Domain","shortdesc":"<p class=\"shortdesc\"\/>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-F666940F-5C61-4E09-8248-E2D8AAA2A1A6","attributes":{"data-id":"GUID-F666940F-5C61-4E09-8248-E2D8AAA2A1A6"},"menu":{"hasChildren":false},"tocID":"GUID-F666940F-5C61-4E09-8248-E2D8AAA2A1A6-d10733e10766","topics":[]},{"title":"<ph>12.4.3<\/ph>\nAdvanced Analysis of I\/Os","shortdesc":"<p class=\"shortdesc\">SmartPower allows you to estimate the power consumption related to I\/Os. You can then         analyze power consumption in detail.<\/p>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-922BAE6C-1622-4711-93BA-05987FD1134B","attributes":{"data-id":"GUID-922BAE6C-1622-4711-93BA-05987FD1134B"},"menu":{"hasChildren":false},"tocID":"GUID-922BAE6C-1622-4711-93BA-05987FD1134B-d10733e10776","topics":[]},{"title":"<ph>12.4.4<\/ph>\nAdding a New Clock Domain","shortdesc":"<p class=\"shortdesc\">When you run SmartPower, it researches your existing clock domains and partitions your         design automatically. <\/p>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-733349B7-D420-45AE-A46F-490143AE1D85","attributes":{"data-id":"GUID-733349B7-D420-45AE-A46F-490143AE1D85"},"menu":{"hasChildren":false},"tocID":"GUID-733349B7-D420-45AE-A46F-490143AE1D85-d10733e10787","topics":[]},{"title":"<ph>12.4.5<\/ph>\nVerifying Lists of Clock and Data Pins of a Clock Domain","shortdesc":"<p class=\"shortdesc\">Beyond the verification of the list of clock domains, you may also wish to verify that         the lists of clock pins and data pins computed for each clock domain are         correct.<\/p>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-5A38584C-D442-472F-839D-8C165AB39C68","attributes":{"data-id":"GUID-5A38584C-D442-472F-839D-8C165AB39C68"},"menu":{"hasChildren":false},"tocID":"GUID-5A38584C-D442-472F-839D-8C165AB39C68-d10733e10798","topics":[]},{"title":"<ph>12.4.6<\/ph>\nAdding a New Set of Pins","shortdesc":"<p class=\"shortdesc\"\/>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-24191BD0-799B-4D7B-A474-CA86C675F14A","attributes":{"data-id":"GUID-24191BD0-799B-4D7B-A474-CA86C675F14A"},"menu":{"hasChildren":false},"tocID":"GUID-24191BD0-799B-4D7B-A474-CA86C675F14A-d10733e10809","topics":[]},{"title":"<ph>12.4.7<\/ph>\nSpecifying Clock and Data Frequencies in SmartPower","shortdesc":"<p class=\"shortdesc\"\/>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-654C007A-2050-4AC0-A27C-B470BA64835B","attributes":{"data-id":"GUID-654C007A-2050-4AC0-A27C-B470BA64835B"},"menu":{"hasChildren":false},"tocID":"GUID-654C007A-2050-4AC0-A27C-B470BA64835B-d10733e10819","topics":[]},{"title":"<ph>12.4.8<\/ph>\nVerifying the InputSet","shortdesc":"<p class=\"shortdesc\"\/>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-6C539A8C-A58E-4B8C-8A66-285AC71C9B23","attributes":{"data-id":"GUID-6C539A8C-A58E-4B8C-8A66-285AC71C9B23"},"menu":{"hasChildren":false},"tocID":"GUID-6C539A8C-A58E-4B8C-8A66-285AC71C9B23-d10733e10829","topics":[]},{"title":"<ph>12.4.9<\/ph>\nSplitting the InputSet ","shortdesc":"<p class=\"shortdesc\">You might want to split the InputSet into several sets in order to specify different         frequencies. For example, you might want to create a ResetSetâ€”a reset tree with a very low         frequency.<\/p>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-5276CBC0-8FD6-4A0A-8D40-13AD931D4D4C","attributes":{"data-id":"GUID-5276CBC0-8FD6-4A0A-8D40-13AD931D4D4C"},"menu":{"hasChildren":false},"tocID":"GUID-5276CBC0-8FD6-4A0A-8D40-13AD931D4D4C-d10733e10839","topics":[]},{"title":"<ph>12.4.10<\/ph>\nSpecifying Individual Pin Frequencies","shortdesc":"<p class=\"shortdesc\">The <strong class=\"ph b\">Frequencies<\/strong> tab allows you to specify an average clock and data frequency for         each clock domain, and also an average frequency for each set of pins. This gives you an         initial estimate of the power consumption of your design. However, if this estimate is not         sufficiently accurate, you can refine it with a pin-by-pin annotation of the         frequency.<\/p>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-EC2E1BB0-8461-4236-A1AA-9FA89C3B7B71","attributes":{"data-id":"GUID-EC2E1BB0-8461-4236-A1AA-9FA89C3B7B71"},"menu":{"hasChildren":false},"tocID":"GUID-EC2E1BB0-8461-4236-A1AA-9FA89C3B7B71-d10733e10850","topics":[]},{"title":"<ph>12.4.11<\/ph>\nChanging the Frequency Annotation of a Pin","shortdesc":"<p class=\"shortdesc\"\/>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-102B1901-2D81-4E69-8E12-723BD8ABBB87","attributes":{"data-id":"GUID-102B1901-2D81-4E69-8E12-723BD8ABBB87"},"menu":{"hasChildren":false},"tocID":"GUID-102B1901-2D81-4E69-8E12-723BD8ABBB87-d10733e10865","topics":[]},{"title":"<ph>12.4.12<\/ph>\nRemoving the Frequency Annotation of a Pin","shortdesc":"<p class=\"shortdesc\"\/>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-9E034ED5-7570-4E67-979C-E6A1FAD4A978","attributes":{"data-id":"GUID-9E034ED5-7570-4E67-979C-E6A1FAD4A978"},"menu":{"hasChildren":false},"tocID":"GUID-9E034ED5-7570-4E67-979C-E6A1FAD4A978-d10733e10875","topics":[]},{"title":"<ph>12.4.13<\/ph>\nSpecifying Individual Pin Probabilities","shortdesc":"<p class=\"shortdesc\">The <strong class=\"ph b\">Probabilities <\/strong>tab allows you to specify the default output probability         value for memory blocks, and tristate and bidirectional I\/Os. In addition, you can increase         the accuracy of the power estimation by annotating the probability of specific         pins.<\/p>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-3558D485-2078-4711-BB1A-D0C4A5E2D03E","attributes":{"data-id":"GUID-3558D485-2078-4711-BB1A-D0C4A5E2D03E"},"menu":{"hasChildren":false},"tocID":"GUID-3558D485-2078-4711-BB1A-D0C4A5E2D03E-d10733e10885","next":"GUID-3558D485-2078-4711-BB1A-D0C4A5E2D03E-d10733e10885"},{"title":"<ph>12.4.14<\/ph>\nVectorless Estimation","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-80F1B302-2A96-40E1-BD59-D332A55B9EA2","attributes":{"data-id":"GUID-80F1B302-2A96-40E1-BD59-D332A55B9EA2"},"menu":{"hasChildren":false},"tocID":"GUID-80F1B302-2A96-40E1-BD59-D332A55B9EA2-d10733e10919","topics":[]},{"title":"<ph>12.4.15<\/ph>\nViewing Results (Design Level)","shortdesc":"<p class=\"shortdesc\">Click the <strong class=\"ph b\">Summary<\/strong> tab to view global power consumption at the design level.         The <strong class=\"ph b\">Summary <\/strong>tab shows your design's estimated power consumption and temperature         information.<\/p>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-41B5C7B6-5659-4144-970D-A5B35B10AD81","attributes":{"data-id":"GUID-41B5C7B6-5659-4144-970D-A5B35B10AD81"},"menu":{"hasChildren":false},"tocID":"GUID-41B5C7B6-5659-4144-970D-A5B35B10AD81-d10733e10927","topics":[]},{"title":"<ph>12.4.16<\/ph>\nAnalyzing Results","shortdesc":"<p class=\"shortdesc\">The <strong class=\"ph b\">Analysis<\/strong> tab shows the estimated power consumption of individual blocks,         gates, nets, I\/Os, and memory, and allows you to make a hierarchical analysis of your power         consumption. <\/p>","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-3BB0DC80-CB8F-4F0F-A274-032B6C63A275","attributes":{"data-id":"GUID-3BB0DC80-CB8F-4F0F-A274-032B6C63A275"},"menu":{"hasChildren":false},"tocID":"GUID-3BB0DC80-CB8F-4F0F-A274-032B6C63A275-d10733e10944","topics":[]},{"title":"<ph>12.4.17<\/ph>\nSmartPower Calculation Equations","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-E1EC4F9E-745D-4F40-987E-24F5E947FB60","attributes":{"data-id":"GUID-E1EC4F9E-745D-4F40-987E-24F5E947FB60"},"menu":{"hasChildren":false},"tocID":"GUID-E1EC4F9E-745D-4F40-987E-24F5E947FB60-d10733e10958","topics":[]},{"title":"<ph>12.4.18<\/ph>\nSample Equations:","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-C9DCD5E8-1F51-4FB7-9331-0CAA8A5BE7B5","attributes":{"data-id":"GUID-C9DCD5E8-1F51-4FB7-9331-0CAA8A5BE7B5"},"menu":{"hasChildren":false},"tocID":"GUID-C9DCD5E8-1F51-4FB7-9331-0CAA8A5BE7B5-d10733e10966","topics":[]},{"title":"<ph>12.4.19<\/ph>\nData Change History - SmartPower","href":"GUID-BA00AD86-BE87-4C16-8451-BB899140C635.html#GUID-56E6AA91-AF9B-4BF5-87E4-3CE53670F003","attributes":{"data-id":"GUID-56E6AA91-AF9B-4BF5-87E4-3CE53670F003"},"menu":{"hasChildren":false},"tocID":"GUID-56E6AA91-AF9B-4BF5-87E4-3CE53670F003-d10733e10974","topics":[]}]});